import Vuex from 'vuex'

import Vue from 'vue'

Vue.use(Vuex)

const store = new Vuex.Store({
    state: {
        currentPathName: ''
    }, // 存放数据
    mutations: {
        setPath (state) {
            state.currentPathName = localStorage.getIPtem("currentPathName")
        }
    }, // 修改state中数据的一些方法


})

export default store
